import React from 'react';
import ImageGallery from 'react-image-gallery';
import styled from 'styled-components'

const Photo = styled.img`
    object-fit: cover;
    width: 100%;
    height: 100%;
    margin-right: 10px;
`

// width: 90%;
// height: 80%;
// margin: 7% 5% 10% 5%;

const PhotoReel = styled.div`
    display: flex;
    flex-direction: row;
    width: 90%;
    height: 80%;
    margin: 7% 5% 10% 5%;
`

const PhotoHolder = styled.div`
    display: flex;
    flex-direction: row;
    width: 100vw;
    height: 100vh;
`

const images = [
    {
        picture: require('../Images/1.jpg'),
    },
    {
        picture: require('../Images/2.jpg'),
    },
    {
        picture: require('../Images/3.jpg'),
    },
    {
        picture: require('../Images/4.jpg'),
    },
    {
        picture: require('../Images/5.jpg'),
    },
    {
        picture: require('../Images/6.jpg'),
    },
]
function Image() {

    return(
        <PhotoHolder>
            <PhotoReel>
                {images.map(i => (
                    <Photo src = {i.picture}/>
                ))}
            </PhotoReel>
        </PhotoHolder>
    );
}

export default Image
